&lt;p&gt;Khi nhắc đến những phẩm chất tạo n&ecirc;n một vị CEO ở Thung lũng Silicon, chắc chắc điều đầu ti&ecirc;n bạn nghĩ đến kh&ocirc;ng phải l&agrave; từ &ldquo;thận trọng&rdquo;.&lt;/p&gt;

&lt;p&gt;Tuy nhi&ecirc;n, theo một nghi&ecirc;n cứu mới đ&acirc;y của c&ocirc;ng ty nghi&ecirc;n cứu việc l&agrave;m Paysa sử dụng dữ liệu từ IBM, thận trọng lại l&agrave; một trong những phẩm chất quan trọng nhất của c&aacute;c nh&agrave; l&atilde;nh đạo c&ocirc;ng nghệ. V&agrave; người thận trọng nhất kh&ocirc;ng ai kh&aacute;c ch&iacute;nh l&agrave; CEO SpaceX v&agrave; Telsa &ndash; &ldquo;dị nh&acirc;n&rdquo; Elon Musk.&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/103738796-gettyimages-163192120-1910x1000-1499136387103.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Để đưa ra được kết luận n&agrave;y, Paysa đ&atilde; sử dụng si&ecirc;u m&aacute;y t&iacute;nh Watson của IBM để đ&aacute;nh gi&aacute; top 11 nh&agrave; l&atilde;nh đạo thận trọng nhất trong thế giới c&ocirc;ng nghệ ở thung lũng Silicon v&agrave; quanh nước Mỹ. C&aacute;c nh&agrave; l&atilde;nh đạo n&agrave;y được chấm theo thang điểm từ 0 (&iacute;t thận trọng nhất) đến 1 (thận trọng nhất).&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Dưới đ&acirc;y l&agrave; danh s&aacute;ch đầy đủ đ&aacute;nh gi&aacute; điểm thận trọng của c&aacute;c CEO c&ocirc;ng nghệ.&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/image16-1499136301959.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Trong khi Elon Musk đạt số điểm &ldquo;thận trọng&rdquo; gần như tuyệt đối 0,96 th&igrave; CEO Cisco Chuck Robbins cũng kh&ocirc;ng k&eacute;m cạnh khi xếp ở vị tr&iacute; &ldquo;s&aacute;t n&uacute;t&rdquo; số 2 với số điểm 0.95. CEO Microsoft Satya Nadella v&agrave; CEO Oracle Larry Ellison theo sau với c&ugrave;ng số điểm 0.91.&lt;/p&gt;

&lt;p&gt;Ngược lại, hai vị CEO được đ&aacute;nh gi&aacute; &ldquo;bất cẩn nhất&rdquo; l&agrave;ng c&ocirc;ng nghệ kh&ocirc;ng phải ai xa lạ m&agrave; ch&iacute;nh l&agrave; Larry Page (CEO của Alphabet) v&agrave; Mark Zuckerberg (CEO của Facebook). Cả hai c&ugrave;ng đạt số điểm &ldquo;ch&oacute;t bảng&rdquo; 0,73.&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://genknews.genkcdn.vn/thumb_w/660/2017/mark-zuckerberg-copy-snapchat-la-buoc-dau-cho-nen-tang-ar-cua-facebook-1499136443839.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Để đi đến kết quả n&agrave;y, Paysa đ&atilde; thu thập những b&agrave;i ph&aacute;t biểu, b&agrave;i tham luận, s&aacute;ch, c&aacute;c bản thảo phỏng vấn v&agrave; nhiều h&igrave;nh thức giao tiếp kh&aacute;c của c&aacute;c CEO. Sau khi thu thập đủ 2.500 từ, họ sẽ &ldquo;nh&eacute;t&rdquo; ch&uacute;ng v&agrave;o chương tr&igrave;nh Ph&acirc;n t&iacute;ch t&iacute;nh c&aacute;ch (Personality Insights) API tr&ecirc;n si&ecirc;u m&aacute;y t&iacute;nh Watson.&lt;/p&gt;

&lt;p&gt;&lt;em&gt;&ldquo;Personality Insights ph&acirc;n t&iacute;ch những đặc điểm c&aacute; nh&acirc;n dựa tr&ecirc;n c&aacute;ch viết. Bạn c&oacute; thể sử dụng dịch vụ n&agrave;y để so s&aacute;nh c&aacute; nh&acirc;n n&agrave;y với những c&aacute; nh&acirc;n kh&aacute;c về cơ hội, sản phẩm hoặc điều chỉnh kinh nghiệm của họ cho ph&ugrave; hợp&rdquo;,&lt;/em&gt;&nbsp;th&ocirc;ng tin đăng tr&ecirc;n website của IBM về si&ecirc;u m&aacute;y t&iacute;nh Watson cho biết.&lt;/p&gt;

&lt;p&gt;Trở lại với kết luận tr&ecirc;n, nhiều người sẽ tỏ ra kh&aacute; ngạc nhi&ecirc;n khi Elon Musk được xem l&agrave; vị CEO thận trọng nhất l&agrave;ng c&ocirc;ng nghệ, đặc biệt trong bối cảnh anh lu&ocirc;n đưa ra những quyết định &ldquo;đi&ecirc;n rồ&rdquo; như muốn đưa con người đặt ch&acirc;n l&ecirc;n sao Hỏa.&lt;/p&gt;

&lt;p&gt;Tuy nhi&ecirc;n, điều quan trọng đối với c&aacute;c CEO c&ocirc;ng nghệ chẳng hạn như nh&agrave; s&aacute;ng lập SpaceX đ&oacute; l&agrave; chấp nhận những rủi ro đ&atilde; được t&iacute;nh to&aacute;n kỹ lưỡng, giống như tỷ ph&uacute; &ldquo;chơi ng&ocirc;ng&rdquo; Richard Branson thường nhấn mạnh, chứ kh&ocirc;ng phải l&agrave; đi&ecirc;n cuồng lao v&agrave;o l&agrave;m những việc phi l&yacute; v&agrave; kh&ocirc;ng mang lại kết quả g&igrave;.&lt;/p&gt;

